import React from "react";


class QuestionItem extends React.Component {

    render() {
        return (
            <li >
                <button type="checkbox"></button>
                <span style={{
                    "marginLeft": "50px",
                    "fontSize": "23px"
                }}>{this.props.quest.text}</span>
            </li>

        )
    }
}

export default QuestionItem
